import Layout from '../components/MyLayout';
import HomeHead from '../components/HomeHead';
import HomeWhat from '../components/HomeWhat';


export default function Index() {
  return (
    <Layout>


      <HomeHead />
      <HomeWhat />
      <HomeSections />
      <div>


      </div>

      <style jsx>{`
        div {
          margin-top: 100px;
          margin-bottom: 50px;
          text-align: center;

        }
        h1 {
          font-size: 40px;
          font-weight: lighter;
        }
        p {
          padding: 25px 75px;
          text-align: justify;
          font-size: 16px;
          color: #777;
        }



      `}</style>




    </Layout>
  );
}
